			--project-color-primary: #081477;

		}

			--project-color-primary: #081477;
			--project-color-inverse: #fff
		}

		a {
			color: #0055d9
		}

		a:hover {
			color: #002d73
		}

		a.text-muted:hover {
			color: #0055d9
		}

		.btn.btn-primary {
			background-color: #0055d9
		}

		.btn.btn-primary:hover {
			background-color: #002d73
		}

		.theme-line #hub-landing-top h2 {
			color: #0055d9
		}

		#hub-landing-top .btn:hover {
			color: #0055d9
		}

		.theme-line #hub-landing-top .btn:hover {
			color: #fff
		}

		.theme-solid header#hub-header #header-top {
			background-color: #081477
		}

			background: linear-gradient(to bottom, #081477, #000532)
		}

		.theme-solid.header-custom header#hub-header #header-top {
			background-image: url(undefined)
		}

		}

			background-color: #081477
		}

		header#hub-header #header-top #header-logo {

		}

		#hub-subheader-parent #hub-subheader .hub-subheader-breadcrumbs .dropdown-menu a:hover {
			background-color: #081477
		}

		#subheader-links a.active {
			color: #081477 !important;
			box-shadow: inset 0 -2px 0 #081477
		}

		#subheader-links a:hover {
			color: #081477 !important;
			box-shadow: inset 0 -2px 0 #081477;
			opacity: .7
		}

		.discussion .submit-vote.submit-vote-parent.voted a.submit-vote-button {
			background-color: #0055d9
		}

		}

		}

		}

		#hub-subheader-parent #hub-subheader.sticky-header.sticky .search-box {
			border-bottom-color: #0055d9
		}

		#hub-search-results h3 em {
			color: #0055d9
		}

		.main_background,
		.tag-item {
			background: #0055d9 !important
		}

		.main_background:hover {
			background: #002d73 !important
		}

			color: #081477 !important
		}

		}

		.main_color_hover:hover {

		}

			color: #0055d9

 of img borders doubling up or breaking.\n*/\n\n/* Global CSS variables */\nbody {\n      --font-family: 'Inter', sans-serif; /* Body typeface */\n      --font-family-mono: 'JetBrains Mono', monospace; /* Mono typeface */\n      --header-logo-height: 32px;\n      --font-weight-bold: 700;\n      --Header-border-color: #D6D9DB;\n      --border-radius: 6px;\n      --LandingPage-heading-color: #000000;\n      --graphite: #1E1E1E;/* highEmphasis color goes here */\n      --minimumGray: #8E8E8E;/* minimumEmphasis color goes here */\n      --edge: #D6D9DB;/* border color goes here */\n      --color-link-background: #CAD6E4;\n  \t\t--markdown-font-size: 16px !important;/* See 'note 1' */\n    \t--markdown-line-height: 24px !important;/* See 'note 1' */\n}\n\n/* Make elements mediumEmphasis */\np, ol, ul, tbody {\n     color: #5C5C5C;\n}\n\n/* Block quote 'Okay' */\nblockquote.callout.callout_okay {\n     --background: #D9F7E8;\n     --title: #1E1E1E;\n     --border: #40BF7F;\n  \t --emoji: unset;\n   \t --icon: \&quot;\\f058\&quot;;\n \t\t --icon-color: #40BF7F;\n     border-radius: 0 6px 6px 0;\n     margin: 16px 0 16px 0;\n}\n\n/* Changing the size of the icon within all block quotes */\n.callout-icon:before {\n \t\t font-size: var(--icon-size,1.4rem)!important; \n}\n\n/* Block quote 'Info' */\nblockquote.callout.callout_info {\n     --background: #DFEBFB;\n     --title: #1E1E1E;\n     --border: #4A95ED;\n  \t --emoji: unset;\n   \t --icon: \&quot;\\f05a\&quot;;\n \t\t --icon-color: #4A95ED;\n     border-radius: 0 6px 6px 0;\n     margin: 16px 0 16px 0;\n}\n\n/* Block quote 'Warn' */\nblockquote.callout.callout_warn {\n     --background: #FFF2DF; /* Does not exist in DS as of 18/05/22 */\n     --title: #1E1E1E;\n     --border: #ffa726; /* Does not exist in DS as of 18/05/22 */\n     --emoji: unset;\n   \t --icon: \&quot;\\f06a\&quot;;\n \t\t --icon-color: #ffa726;\n     border-radius: 0 6px 6px 0;\n     margin: 16px 0 16px 0;\n}\n\n/* [ENTERPRISE ONLY! see 'note 2'] Basic
